import React from "react";

const Navbar = ({ handleSearch }) => {
  return (
    <div className="navbar">
      <input
        type="text"
        placeholder="Search..."
        onChange={(e) => handleSearch(e.target.value)}
      />
    </div>
  );
};

export default Navbar;
